import CardList from "./CardList";
import { robots } from "./robots"

const App = ()=>{
  return(
    <div>
      <CardList id={robots[0].id} name={robots[0].name} email={robots[0].email}/>
      <CardList />
      <CardList />
    </div>
  )
}

export default App;
